import React from 'react'

const CourseFilter = () => {
  return (
    <nav>
      <ul>
        <li href="">All</li>
        <li href="">Full-time</li>
        <li href="">Self-Paced</li>
        <li href="">Corporate</li>
      </ul>
    </nav>
  )
}

export default CourseFilter;
